# 6/6/26
# This file contains common pin mappings for the BIGTREETECH Manta M8P
# To use this config, the firmware should be compiled for the
# STM32G0B1 with a "8KiB bootloader" "8 MHz crystal"
# and "CAN bus (on PD12/PD13)".

# See docs/Config_Reference.md for a description of parameters.

##################################
# Micro-controller configuration #
##################################
[mcu]
#   Configuration of the primary micro-controller.
canbus_uuid: a87a2c3a65cc
canbus_interface: can0

[mcu EBBCan]
#    Tool head canbus board
canbus_uuid: 20eb10e3f813
canbus_interface: can0

[mcu rpi]
#   Configuration of the Raspberry Pi CM4 as a
#   controller for chassis fan control.
serial: /tmp/klipper_host_mcu

#################
# Include Files #
#################
[include macros.cfg]
[include leds.cfg]
[include K-ShakeTune/*.cfg]

######################
# Kinematic settings #
######################
[printer]
#   The printer section controls high level printer settings.
kinematics: corexy
max_velocity: 600
max_accel: 3000
minimum_cruise_ratio: 0.5
#max_accel_to_decel: 1000
max_z_velocity: 15
max_z_accel: 350
square_corner_velocity: 5

[stepper_x] # M1 - A Motor
step_pin: PE6
dir_pin: !PE5
enable_pin: !PC14
microsteps: 16
rotation_distance: 40
#endstop_pin: ^PF4
endstop_pin: tmc2209_stepper_x:virtual_endstop
position_endstop: -12
position_min: -12
position_max: 270
homing_speed: 20
#second_homing_speed: 3
homing_retract_dist: 0

[stepper_y] # M2 - B Motor
step_pin: PE2
dir_pin: !PE1
enable_pin: !PE4
microsteps: 16
rotation_distance: 40
endstop_pin: ^PF3
position_endstop: 0
position_max: 250
homing_speed: 100
second_homing_speed: 3
homing_retract_dist: 5

[stepper_z] # M3 - ZB Motor
step_pin: PB8
dir_pin: PB7
enable_pin: !PE0
# Leadscrew is Tr8x2 - 1 Start
rotation_distance: 2
full_steps_per_rotation: 200
microsteps: 16
endstop_pin: probe:z_virtual_endstop
#position_endstop = 0.440
position_max: 300
position_min: -5.0
homing_speed: 10
homing_retract_dist: 0

[stepper_z1] # M4 - ZL Motor
step_pin: PB4
dir_pin: PB3
enable_pin: !PB6
rotation_distance: 2
full_steps_per_rotation: 200
microsteps: 16

[stepper_z2] # M5 - ZR Motor
step_pin: PG13
dir_pin: PG12
enable_pin: !PG15
rotation_distance: 2
full_steps_per_rotation: 200
microsteps: 16

## Motor6
#[extruder1]
